import { ACTION_TYPES } from "../../../constants/actionTypes";

export const loginAction = () => {
    return {
        type: ACTION_TYPES.LOGIN,  
    }
}

export const logoutAction = () => {
    return {
        type: ACTION_TYPES.LOGOUT,
    }   
}
